def minSkew(genome):
    ret = []
    ls = [0]
    currCount = 0
    for i in genome:
        #print(i)
        if i == 'C':
            currCount -= 1
        if i == 'G':
            currCount += 1
        ls.append(currCount)
    min_ls = min(ls)
    for idx, i in enumerate(ls):
        if i == min_ls:
            ret.append(idx)
    return ' '.join(map(str, ret))

genome = ''#sys.stdin.read()
print(minSkew(genome))